import React from 'react';
import Toolbar from './componentes/Toolbar/Toolbar'
import './App.css';
import Topbuttons from './componentes/Topbuttons/Topbuttons';
import SetencaBox from './componentes/SetencaBox/SetencaBox';
import SetencaBox2 from './componentes/SetencaBox2/SetencaBox2';

class PageSelect extends React.Component{
  constructor(props){
    super();
    this.state = {
        inNew : true,
        setenceBox : true,
    }
  }

  changeSetencBox(){
    if(this.props.inNew){
      this.setState({setenceBox:true})
    }
    else{
      this.setState({setenceBox:false})
    }
  }

  render(){
    let setence ;
    if(!this.props.setenceBox){
      setence = <SetencaBox/>
    }
    else{
      setence = <SetencaBox2/>
    }

    return(
      <div>
         <Topbuttons inNew = {(e)=>this.setState( {isNew:true})} />
          <div className = "space_setence">
            {setence}
          </div>
          <div className = "space_setence">
            {setence}
          </div>
          <div className = "space_setence">
            {setence}
          </div>
      </div>
    )
  }
}

function App() {
  return (
     <div className="home">
      <header className="navbar_toolbar">
        <Toolbar /> 
      </header>
        <div className= "topbuttonDiv">
          <PageSelect/>
        </div>
    </div>
  );
}

export default App;
